import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
import {Sidebar} from './react-sidebar'
import {VideoGallery} from './react-video-gallery'


const displayContents = {
    name: "Shed Studio",
    description: "Custom multimedia marketing packages tailored to you",
    avatarUrl: "https://res.cloudinary.com/dwtivbec9/image/upload/v1542456067/jake-walker-1155669-unsplash.jpg",
    email: "anemail.gmail.com",
    facebook: "https://facebook.com",
    instagram: "https://instagram.com",
    youtube: "https://youtube.com"
}
class App extends React.Component
{
    constructor(props)
    {
        super(props)
        this.state = displayContents
    }

    render()
    {
        return(
            <div id="site-wrapper">
                <Sidebar {...this.state} />
                <VideoGallery galleryTitle="Bring your videos to life"/>
            </div>
        )
    }
}

ReactDOM.render(<App />,
                document.getElementById('root'))
